package com.smallluosid.aaaatestandroid

import android.content.ClipData
import android.content.pm.PackageManager
import android.os.Bundle
import android.util.Log
import android.view.View
import android.widget.Toast
import androidx.activity.ComponentActivity
import androidx.core.content.ContextCompat
import kotlin.math.min

class MainActivity : ComponentActivity() {
    override fun onCreate(savedInstanceState: Bundle?) {
        super.onCreate(savedInstanceState)
        setContentView(R.layout.activity_main)
        findViewById<View>(R.id.checkInternet).setOnClickListener {
            val permiss = ContextCompat.checkSelfPermission(this@MainActivity, android.Manifest.permission.INTERNET)
            val check = permiss == PackageManager.PERMISSION_GRANTED
            Toast.makeText(this@MainActivity, "是否有网络权限 : ${check}", Toast.LENGTH_SHORT).show()
        }
        findViewById<View>(R.id.playMusic).setOnClickListener {
            BgmHelper.playBgm()
        }
        findViewById<View>(R.id.stopMusic).setOnClickListener {
            BgmHelper.stopBgm()
        }
        findViewById<View>(R.id.playErrorMusic).setOnClickListener {
            BgmHelper.playErrorBgm()
        }
        findViewById<View>(R.id.checkUrl).setOnClickListener {
            val stop = BgmHelper.checkResourceExists(BgmHelper.error_audioUrl)
            Toast.makeText(this@MainActivity, "播放错误音乐 : ${stop}", Toast.LENGTH_SHORT).show()
        }
        findViewById<View>(R.id.parseDes).setOnClickListener {
            val textStr = desString
            val desTextStr = DesUtils.decrypt(textStr)
            copy(desTextStr)
            toast("复制成功")
            Log.i("TAG", desTextStr)
            printLongString(desTextStr)
        }
    }

    private fun printLongString(longString: String) {
        val maxLength = 4000 // Logcat输出的最大长度限制左右，具体可能因设备和系统略有差异
        if (longString.length > maxLength) {
            var i = 0
            while (i < longString.length) {
                val endIndex =
                    min((i + maxLength).toDouble(), longString.length.toDouble()).toInt()
                Log.d("TAG", longString.substring(i, endIndex))
                i += maxLength
            }
        } else {
            Log.d("TAG", longString)
        }
    }

    val desString2 = ""
    val desString = ""

    private fun toast(text: String) {
        Toast.makeText(this@MainActivity, text, Toast.LENGTH_SHORT).show()
    }

    private fun copy(text: String) {
        val clipboard = getSystemService(CLIPBOARD_SERVICE) as android.content.ClipboardManager
        val clipData = ClipData.newPlainText(null, text)
        clipboard.setPrimaryClip(clipData)
    }
}